function resetAudioElement(element: HTMLAudioElement) {
  try {
    element.pause();
  } catch {
    // Ignore pause errors from browsers that block immediate playback.
  }
  try {
    element.currentTime = 0;
  } catch {
    // Ignore reset errors when the browser prevents seeking.
  }
}

function playAudioElement(element: HTMLAudioElement) {
  try {
    resetAudioElement(element);
    const playPromise = element.play();
    if (playPromise && typeof playPromise.catch === 'function') {
      playPromise.catch(() => {
        // Ignore playback errors that can occur due to browser autoplay policies.
      });
    }
  } catch {
    // Swallow exceptions triggered by browsers that block immediate playback.
  }
}

export function useStudySounds(active: boolean): StudySoundControls {
  const audiosRef = useRef<AudioMap>({ new: null, right: null, wrong: null });
  const activeRef = useRef(active);
  activeRef.current = active;

  useEffect(() => {
    if (!active) return;
    if (typeof window === 'undefined') return;
    if (typeof Audio === 'undefined') return;

    (Object.keys(SOUND_DATA_URIS) as StudySoundName[]).forEach((key) => {
      const existing = audiosRef.current[key];
      if (existing) return;
      const audio = new Audio(SOUND_DATA_URIS[key]);
      audio.preload = 'auto';
      audio.volume = 1;
      audiosRef.current[key] = audio;
    });
  }, [active]);

  useEffect(() => {
    return () => {
      (Object.keys(SOUND_DATA_URIS) as StudySoundName[]).forEach((key) => {
        const audio = audiosRef.current[key];
        if (!audio) return;
        resetAudioElement(audio);
      });
    };
  }, []);

  const stopOtherSounds = useCallback((activeName: StudySoundName) => {
    (Object.keys(SOUND_DATA_URIS) as StudySoundName[]).forEach((key) => {
      if (key === activeName) return;
      const otherAudio = audiosRef.current[key];
      if (!otherAudio) return;
      resetAudioElement(otherAudio);
    });
  }, []);

  const getAudio = useCallback((name: StudySoundName): HTMLAudioElement | null => {
    if (!activeRef.current) return null;
    if (typeof Audio === 'undefined') return null;
    let audio = audiosRef.current[name];
    if (!audio) {
      audio = new Audio(SOUND_DATA_URIS[name]);
      audio.preload = 'auto';
      audiosRef.current[name] = audio;
    }
    return audio;
  }, []);

  const play = useCallback(
    (name: StudySoundName) => {
      const audio = getAudio(name);
      if (!audio) return;
      stopOtherSounds(name);
      playAudioElement(audio);
    },
    [getAudio, stopOtherSounds],
  );

  return {
    playNew: useCallback(() => play('new'), [play]),
    playRight: useCallback(() => play('right'), [play]),
    playWrong: useCallback(() => play('wrong'), [play]),
  };
}
